import functools
import sys

sys.setrecursionlimit(3_000)


MOD = 1_000_000_007


class Solution:
    def parse(self, word: str) -> list[tuple[str, int]]:
        if word == "":
            return []
        arr = []
        last = word[0]
        count = 1
        for char in word[1:]:
            if last == char:
                count += 1
            else:
                arr.append((last, count))
                last, count = char, 1

        arr.append((last, count))
        return arr

    def _shorter_than_k(self, idx: int, k: int) -> int:
        """
        how many ways to create a word shorter than k
        """

        # if there are more than k distinct letters the word will be longer than k
        if (self.len - idx) >= k:
            return 0

        # if no more letters to add - return 1
        if self.len == idx:
            return 1

        res = 0

        if idx not in self.pref_sum:
            limit = self.K + 1 - idx
            dp = [0] * (limit)
            for x in range(limit):
                dp[x] = self._shorter_than_k(idx + 1, x)

            prefsum = [None] * (limit + 1)
            prefsum[0] = 0

            for x in range(limit):
                prefsum[x + 1] = (dp[x] + prefsum[x]) % MOD

            self.pref_sum[idx] = prefsum

        _, count = self.arr[idx]
        # <k-count .. k-1>
        res = (self.pref_sum[idx][k] - self.pref_sum[idx][max(k - count, 0)] + MOD) % MOD

        return res

    def possibleStringCount(self, word: str, k: int) -> int:
        self.indent = 0

        arr = list(self.parse(word))

        self.arr = arr
        self.K = k
        self.pref_sum = {}
        self.len = len(arr)

        neg = self._shorter_than_k(0, k)
        prod = functools.reduce(lambda x, y: x * y % MOD, map(lambda x: x[1], arr))
        return (MOD + prod - neg) % MOD


def test():
    word = "aabbccdd"
    k = 7
    res = 5
    assert Solution().possibleStringCount(word=word, k=k) == res


